import React from 'react';
import { Card , CardImg, CardText, CardBody, CardTitle, CardSubtitle, Button } from 'reactstrap';
import './WorkCard.scss';

const WorkCard = () => {
  return (
    <Card className="work-card">
      <CardImg className="work-card__img" top width="100%" height="50rem" src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180" alt="Card image cap" />
      <CardBody className="work-card__body">
        <CardTitle className="work-card__title">Card title</CardTitle>
        <CardSubtitle>Card subtitle</CardSubtitle>
        <CardText className="work-card__text">Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
        <Button className="work-card__button">Button</Button>
      </CardBody>
    </Card>
  )
}

export default WorkCard
